import { initAuth0 } from '@auth0/nextjs-auth0'

export default initAuth0({
  clientId: process.env.AUTHO_CLIENT_ID,
  clientSecret: process.env.AUTHO_CLIENT_SECRET,
  scope: process.env.AUTHO_SCOPE,
  domain: process.env.AUTHO_DOMAIN,
  redirectUri: process.env.AUTHO_REDIRECT_URI,
  postLogoutRedirectUri: process.env.AUTHO_LOGOUT_REDIRECT_URI,
  session: {
    cookieSecret: process.env.AUTHO_SESSION_SECRET,
    cookieLifetime: process.env.AUTHO_SESSION_COOKIE_TIME
  }
})
